<span class="line"><span style="color:#F07178;">    </span><span style="color:#C792EA;">int</span><span style="color:#F07178;">\xA0len</span><span style="color:#89DDFF;">;</span><span style="color:#676E95;">	//\u8BB0\u5F55buf\u6570\u7EC4\u4E2D\u5DF2\u4F7F\u7528\u5B57\u8282\u7684\u6570\u91CF\uFF0C\u5373\u7B49\u4E8E SDS \u5F53\u524D\u4FDD\u5B58\u5B57\u7B26\u4E32\u7684\u957F\u5EA6	</span></span>
